INSERT INTO `blogs` (`id`, `shortdescription`, `title`, `subjectId`, `statusId`, `image`, `contentMarkdown`, `contentHTML`, `userId`, `view`, `createdAt`, `updatedAt`) VALUES
(1, 'TTO - Truyền thông Trung Quốc cho biết đợt bùng phát dịch mới nhất ở tỉnh An Huy, miền đông Trung Quốc, cho thấy tình thế tiến thoái lưỡng nan trong chống dịch COVID-19 ở các vùng nông thôn của nước này.', 'COVID-19 lan đến nông thôn, báo Trung Quốc thừa nhận \'thực tế khắc nghiệt\'', 'cham-soc-suc-khoe', 'S1', , '\nTheo Thời báo Hoàn Cầu ngày 4-7, trong khi các thành phố lớn của Trung Quốc như Bắc Kinh và Thượng Hải đã từng bước xây dựng một hệ thống hoàn chỉnh để đối phó với COVID-19, thì những khu vực cấp huyện và các khu vực nông thôn - nơi các nguồn lực y tế ít hơn - đang phải đối mặt với một \"cuộc thử nghiệm\" nghiêm trọng, như trong đợt bùng phát dịch mới nhất ở huyện Tứ ở tỉnh An Huy.\n\nTính tới chiều 4-7, huyện Tứ đã ghi nhận 863 ca nhiễm trong đợt bùng phát mới nhất bắt đầu từ ngày 26-6. Huyện này đã thông báo tiến hành đợt xét nghiệm PCR đại trà vào ngày 4-7. Từ ngày 26-6 đến 3-7, đã có 6 đợt xét nghiệm PCR với hơn 3 triệu mẫu thu về.\n\nHuyện Tứ là nơi ghi nhận số ca nhiễm nhiều nhất ở tỉnh An Huy. Chính quyền An Huy đã phân bổ tất cả các nguồn lực trong tỉnh để hỗ trợ huyện Tứ đối phó COVID-19.\n\nTheo Thời báo Hoàn Cầu, một thực tế khắc nghiệt đã được chứng minh trong đợt bùng phát dịch ở huyện Tứ là những kinh nghiệm mà Bắc Kinh và Thượng Hải thu được đã không thể dễ dàng được áp dụng ở những khu vực kém phát triển - những nơi thiếu nguồn lực y tế.\n\nĐiều kiện y tế kém và sự phân bố dân cư phân tán ở các vùng nông thôn khiến mục tiêu điều tra dịch tễ học nhanh chóng và hiệu quả trở nên khó thực hiện hơn.\n\nNgoài ra, ông Lư Hồng Châu (Lu Hongzhou), người đứng đầu Bệnh viện Nhân dân Thâm Quyến số 3, cho biết người dân ở các khu vực nông thôn nước này có ý thức phòng chống dịch kém hơn. Virus dễ lây lan ở những khu vực này khi mọi người tụ tập và khi người lao động di chuyển đến nơi khác làm việc.\n\nDo đó, ông Lư kêu gọi giáo dục nhiều hơn cho người dân địa phương và đào tạo cho nhân viên y tế địa phương để tạo thói quen tốt cho người dân về việc xét nghiệm PCR thường xuyên và báo cáo kết quả xét nghiệm bất thường. Ông cũng đề nghị chính quyền các vùng nông thôn quan tâm hơn đến lao động nhập cư.\n\nHuyện Tứ (Sixian) nằm ở đông bắc tỉnh An Huy, có dân số 700.000 người và đóng vai trò là nơi cung cấp lao động nhập cư cho tỉnh Giang Tô lân cận. Tác động của đợt bùng phát mới nhất tại huyện Tứ đã nhanh chóng lan rộng ra bên ngoài huyện này, lan tới các địa điểm quan trọng khác ở khu vực đồng bằng sông Dương Tử (Trường Giang) như TP Vô Tích ở tỉnh Giang Tô và TP Nghĩa Ô ở tỉnh Chiết Giang.\n\nTP Vô Tích có dân số 7,46 triệu người, gấp 10 lần huyện Tứ. Theo chính quyền Vô Tích, thành phố này đã phát hiện 7 ca bệnh COVID-19 vào ngày 29-6. Hai trong số các ca nhiễm là công nhân nhập cư đến từ huyện Tứ và 5 người khác là đồng nghiệp hoặc bạn cùng phòng của họ.\n\n\n> Đợt bùng phát dịch ở huyện Tứ đã thu hút sự chú ý của công chúng trong bối cảnh TP Bắc Kinh và Thượng Hải, những nơi bị ảnh hưởng nặng nề bởi đợt dịch do biến thể Omicron, tuyên bố không còn phát hiện ca nhiễm mới nào và đang nới lỏng các biện pháp hạn chế. Trung Quốc cũng vừa rút ngắn thời gian cách ly tập trung đối với những người nhập cảnh.\n\n\n', '<p>Theo Thời báo Hoàn Cầu ngày 4-7, trong khi các thành phố lớn của Trung Quốc như Bắc Kinh và Thượng Hải đã từng bước xây dựng một hệ thống hoàn chỉnh để đối phó với COVID-19, thì những khu vực cấp huyện và các khu vực nông thôn - nơi các nguồn lực y tế ít hơn - đang phải đối mặt với một &quot;cuộc thử nghiệm&quot; nghiêm trọng, như trong đợt bùng phát dịch mới nhất ở huyện Tứ ở tỉnh An Huy.</p>\n<p>Tính tới chiều 4-7, huyện Tứ đã ghi nhận 863 ca nhiễm trong đợt bùng phát mới nhất bắt đầu từ ngày 26-6. Huyện này đã thông báo tiến hành đợt xét nghiệm PCR đại trà vào ngày 4-7. Từ ngày 26-6 đến 3-7, đã có 6 đợt xét nghiệm PCR với hơn 3 triệu mẫu thu về.</p>\n<p>Huyện Tứ là nơi ghi nhận số ca nhiễm nhiều nhất ở tỉnh An Huy. Chính quyền An Huy đã phân bổ tất cả các nguồn lực trong tỉnh để hỗ trợ huyện Tứ đối phó COVID-19.</p>\n<p>Theo Thời báo Hoàn Cầu, một thực tế khắc nghiệt đã được chứng minh trong đợt bùng phát dịch ở huyện Tứ là những kinh nghiệm mà Bắc Kinh và Thượng Hải thu được đã không thể dễ dàng được áp dụng ở những khu vực kém phát triển - những nơi thiếu nguồn lực y tế.</p>\n<p>Điều kiện y tế kém và sự phân bố dân cư phân tán ở các vùng nông thôn khiến mục tiêu điều tra dịch tễ học nhanh chóng và hiệu quả trở nên khó thực hiện hơn.</p>\n<p>Ngoài ra, ông Lư Hồng Châu (Lu Hongzhou), người đứng đầu Bệnh viện Nhân dân Thâm Quyến số 3, cho biết người dân ở các khu vực nông thôn nước này có ý thức phòng chống dịch kém hơn. Virus dễ lây lan ở những khu vực này khi mọi người tụ tập và khi người lao động di chuyển đến nơi khác làm việc.</p>\n<p>Do đó, ông Lư kêu gọi giáo dục nhiều hơn cho người dân địa phương và đào tạo cho nhân viên y tế địa phương để tạo thói quen tốt cho người dân về việc xét nghiệm PCR thường xuyên và báo cáo kết quả xét nghiệm bất thường. Ông cũng đề nghị chính quyền các vùng nông thôn quan tâm hơn đến lao động nhập cư.</p>\n<p>Huyện Tứ (Sixian) nằm ở đông bắc tỉnh An Huy, có dân số 700.000 người và đóng vai trò là nơi cung cấp lao động nhập cư cho tỉnh Giang Tô lân cận. Tác động của đợt bùng phát mới nhất tại huyện Tứ đã nhanh chóng lan rộng ra bên ngoài huyện này, lan tới các địa điểm quan trọng khác ở khu vực đồng bằng sông Dương Tử (Trường Giang) như TP Vô Tích ở tỉnh Giang Tô và TP Nghĩa Ô ở tỉnh Chiết Giang.</p>\n<p>TP Vô Tích có dân số 7,46 triệu người, gấp 10 lần huyện Tứ. Theo chính quyền Vô Tích, thành phố này đã phát hiện 7 ca bệnh COVID-19 vào ngày 29-6. Hai trong số các ca nhiễm là công nhân nhập cư đến từ huyện Tứ và 5 người khác là đồng nghiệp hoặc bạn cùng phòng của họ.</p>\n<blockquote>\n<p>Đợt bùng phát dịch ở huyện Tứ đã thu hút sự chú ý của công chúng trong bối cảnh TP Bắc Kinh và Thượng Hải, những nơi bị ảnh hưởng nặng nề bởi đợt dịch do biến thể Omicron, tuyên bố không còn phát hiện ca nhiễm mới nào và đang nới lỏng các biện pháp hạn chế. Trung Quốc cũng vừa rút ngắn thời gian cách ly tập trung đối với những người nhập cảnh.</p>\n</blockquote>\n', 16, 45, '2022-07-05 13:45:16', '2022-12-25 23:12:03');
INSERT INTO `blogs` (`id`, `shortdescription`, `title`, `subjectId`, `statusId`, `image`, `contentMarkdown`, `contentHTML`, `userId`, `view`, `createdAt`, `updatedAt`) VALUES
(2, 'TTO - Một người tự xưng là tin tặc đang gây sốc khi rao bán thông tin của 1 tỉ người dân Trung Quốc với giá 10 bitcoin (khoảng 200.000 USD). Theo tin tặc là do cơ sở dữ liệu của cảnh sát Thượng Hải bị xâm nhập.', 'Tin tặc rao bán dữ liệu của 1 tỉ dân Trung Quốc', 'cong-nghe-moi', 'S1', , 'Theo Hãng tin Reuters ngày 4-7, sự việc đã gây xôn xao mấy ngày qua sau khi tin rao bán được đăng tải trên diễn đàn tin tặc mang tên Breach Forums hồi tuần trước.\n\nTheo đó, một tài khoản có tên \"ChinaDan\" rao bán hơn 23 terabyte (TB) dữ liệu đánh cắp từ cơ sở dữ liệu của lực lượng cảnh sát quốc gia tại Thượng Hải. Các dữ liệu này bao gồm thông tin về tên, địa chỉ, nơi sinh, số thẻ căn cước, số điện thoại di động và hồ sơ tư pháp của khoảng 1 tỉ dân Trung Quốc.\n\nĐể chứng minh, ChinaDan đăng hình ảnh được cho là dữ liệu của khoảng 750.000 người dân Trung Quốc.\n\nBài đăng đã trở thành chủ đề tranh luận trên các nền tảng xã hội tại Trung Quốc như Weibo, WeChat. Nhiều người dùng lo ngại rằng thông tin này có thể là thật trong khi chính quyền và cảnh sát Thượng Hải vẫn im lặng về vụ việc.\n\nHashtag \"rò rỉ dữ liệu\" đã bị chặn trên Weibo từ chiều 3-7 cho thấy nhà chức trách đã nắm được thông tin.\n\nTrên mạng Twitter (bị chặn tại Trung Quốc), trưởng nhóm nghiên cứu chính sách công nghệ của Công ty tư vấn Trivium China, bà Kendra Schaefer nhận định rất khó để phân biệt sự thật với tin đồn trên mạng.\n\nTuy nhiên, nếu dữ liệu trên là của Bộ Công an Trung Quốc, đây sẽ là một trong những vụ tấn công mạng nghiêm trọng nhất và lớn nhất lịch sử.\n\nGiám đốc điều hành Binance, ông Zhao Changpeng cho biết sàn giao dịch tiền điện tử này đã tăng cường công tác xác minh, sau khi phát hiện dữ liệu của 1 tỉ người dân Trung Quốc bị đăng bán trên dark web - một phần của hệ thống Internet nhưng không phải ai cũng biết cách truy cập.\n\nÔng Zhao suy đoán nguyên nhân do lập trình viên vô tình làm lộ khóa nên hacker có thể xâm nhập hệ thống.\n\nVụ việc có thể ảnh hưởng không nhỏ đến uy tín của Chính phủ Trung Quốc. Trong những năm qua, chính quyền cam kết với người dân sẽ bảo vệ các dữ liệu riêng tư của họ và siết chặt quản lý với những nền tảng công nghệ trong nước.\n\nGiới chức Trung Quốc khi đó lo ngại những dữ liệu khổng lồ về dân cư trên các nền tảng công nghệ có thể bị khai thác hoặc sử dụng sai mục đích, đe dọa an ninh quốc gia.', '<p>Theo Hãng tin Reuters ngày 4-7, sự việc đã gây xôn xao mấy ngày qua sau khi tin rao bán được đăng tải trên diễn đàn tin tặc mang tên Breach Forums hồi tuần trước.</p>\n<p>Theo đó, một tài khoản có tên &quot;ChinaDan&quot; rao bán hơn 23 terabyte (TB) dữ liệu đánh cắp từ cơ sở dữ liệu của lực lượng cảnh sát quốc gia tại Thượng Hải. Các dữ liệu này bao gồm thông tin về tên, địa chỉ, nơi sinh, số thẻ căn cước, số điện thoại di động và hồ sơ tư pháp của khoảng 1 tỉ dân Trung Quốc.</p>\n<p>Để chứng minh, ChinaDan đăng hình ảnh được cho là dữ liệu của khoảng 750.000 người dân Trung Quốc.</p>\n<p>Bài đăng đã trở thành chủ đề tranh luận trên các nền tảng xã hội tại Trung Quốc như Weibo, WeChat. Nhiều người dùng lo ngại rằng thông tin này có thể là thật trong khi chính quyền và cảnh sát Thượng Hải vẫn im lặng về vụ việc.</p>\n<p>Hashtag &quot;rò rỉ dữ liệu&quot; đã bị chặn trên Weibo từ chiều 3-7 cho thấy nhà chức trách đã nắm được thông tin.</p>\n<p>Trên mạng Twitter (bị chặn tại Trung Quốc), trưởng nhóm nghiên cứu chính sách công nghệ của Công ty tư vấn Trivium China, bà Kendra Schaefer nhận định rất khó để phân biệt sự thật với tin đồn trên mạng.</p>\n<p>Tuy nhiên, nếu dữ liệu trên là của Bộ Công an Trung Quốc, đây sẽ là một trong những vụ tấn công mạng nghiêm trọng nhất và lớn nhất lịch sử.</p>\n<p>Giám đốc điều hành Binance, ông Zhao Changpeng cho biết sàn giao dịch tiền điện tử này đã tăng cường công tác xác minh, sau khi phát hiện dữ liệu của 1 tỉ người dân Trung Quốc bị đăng bán trên dark web - một phần của hệ thống Internet nhưng không phải ai cũng biết cách truy cập.</p>\n<p>Ông Zhao suy đoán nguyên nhân do lập trình viên vô tình làm lộ khóa nên hacker có thể xâm nhập hệ thống.</p>\n<p>Vụ việc có thể ảnh hưởng không nhỏ đến uy tín của Chính phủ Trung Quốc. Trong những năm qua, chính quyền cam kết với người dân sẽ bảo vệ các dữ liệu riêng tư của họ và siết chặt quản lý với những nền tảng công nghệ trong nước.</p>\n<p>Giới chức Trung Quốc khi đó lo ngại những dữ liệu khổng lồ về dân cư trên các nền tảng công nghệ có thể bị khai thác hoặc sử dụng sai mục đích, đe dọa an ninh quốc gia.</p>\n', 16, 113, '2022-07-05 13:47:25', '2022-11-27 17:47:43');
INSERT INTO `blogs` (`id`, `shortdescription`, `title`, `subjectId`, `statusId`, `image`, `contentMarkdown`, `contentHTML`, `userId`, `view`, `createdAt`, `updatedAt`) VALUES
(3, 'TTO - Trong hai ngày 2 và 3-7, tại thành phố Đà Nẵng, siêu mẫu Xuân Lan tổ chức tuần lễ thời trang kép gồm Destination Runway Fashion Week và Vietnam Junior Fashion Week. Xuân Lan đảm nhận vai trò sản xuất và đạo diễn catwalk.', 'Cuộc sống an yên trong show thời trang của Xuân Lan', 'thoi-trang-tuoi-teen', 'S1', , '![](https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/2919401215432044675448905204179294377010181n-1656866602443299339591.jpg)\n\nXuân Lan cho biết Destination Runway Fashion Week (tạm dịch: Tuần lễ thời trang điểm đến) là một dự án mới do Xuân Lan sáng lập. Mùa đầu tiên có chủ đề The Legend of the Blue Sea (Huyền thoại biển xanh) với mong muốn giới thiệu những vùng biển đẹp, những điểm đến hấp dẫn trên cả nước thông qua biểu diễn thời trang kết hợp quảng bá điểm đến, mang đến sự mới lạ cho khán giả.\n\nCòn Vietnam Junior Fashion Week (Tuần lễ thời trang trẻ em) tiếp tục lan tỏa thông điệp về chiến dịch \"Bảo vệ quyền trẻ em\", góp phần bảo vệ quyền lợi chính đáng cho các em.\n\nHai tuần lễ thời trang này diễn ra xen kẽ nhau, quy tụ khoảng 1.000 người mẫu lớn và nhí. Trong đó, có khoảng 100 văn nghệ sĩ như Hương Giang, Cindy Thái Tài, TyhD Thùy Dương, Cao Thiên Trang, bé Thỏ - con Xuân Lan, gia đình ca sĩ Khánh Đơn, ca sĩ Khánh Linh, nghệ sĩ violin Hoàng Rob… Nguyễn Ngọc Lâm làm tổng đạo diễn chương trình.\n\n![](https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/cao-thien-trang-first-face-cho-thuong-hieu-lalalune-16568667181231738894820.jpeg)\n\nGóp mặt trong hai show thời trang này có 15 nhà thiết kế như Trương Thanh Long, Linh San, Dexnol, An ST, Tommy Trường, Lê Thanh Phương, Trinh Châu, Ó Princess, Eunoiabyan, Guon, Thỏ Nhím…\n\nHương Giang, TyhD, Cao Thiên Trang… giữ vị trí quan trọng cho các bộ sưu tập. Trong đó, Hương Giang hóa nữ hoàng biển xanh, giữ vai trò vedette trong bộ sưu tập \"Hành vân lưu thủy\" của nhà thiết kế An ST.\n\nThông qua bộ sưu tập này, các người mẫu mong muốn truyền tải được thông điệp vận hành tuần hoàn của tự nhiên, đồng thời nhắc nhớ về cuộc sống an yên.\n\n![](https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/hoa-hau-huong-giang-vedette-cho-ntk-anst-16568667990581116382954.jpeg)\n\nNhà thiết kế Tommy Tường Lê mang đến bộ sưu tập \"Khi giấc mơ về\" với những mẫu thiết kế mới, gợi ý xu hướng mùa hè. \n\nNhà thiết kế Trương Thanh Long trình làng bộ sưu tập \"Kẹo bông và đám mây\", được lấy ý tưởng từ những đám mây trắng bay lượn, đó là một thế giới ngập tràn màu hồng, màu của ngọt ngào và yêu thương.\n\n![](https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/thuy-duong-vedette-cho-thuong-hieu-lalalune-16568668658431739049668.jpeg)\n\nBộ sưu tập \"Cầu vồng trên biển\" cũng để lại ấn tượng trong khán giả với những chiếc đầm được cắt xẻ tinh tế từ kiểu dáng đến các họa tiết. Đặc biệt, gia đình ca sĩ Khánh Đơn xuất hiện với vai trò vedette.\n\nBên cạnh đó, nhiều nhà thiết kế đã giới thiệu đến công chúng những bộ sưu tập mới nhất, gợi ý phong cách thời trang cho nhiều người và có cả những em nhỏ.\n\nHai đêm diễn thời trang thu hút đông đảo khán giả đến theo dõi.', '<p><img src=\"https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/2919401215432044675448905204179294377010181n-1656866602443299339591.jpg\" alt=\"\"></p>\n<p>Xuân Lan cho biết Destination Runway Fashion Week (tạm dịch: Tuần lễ thời trang điểm đến) là một dự án mới do Xuân Lan sáng lập. Mùa đầu tiên có chủ đề The Legend of the Blue Sea (Huyền thoại biển xanh) với mong muốn giới thiệu những vùng biển đẹp, những điểm đến hấp dẫn trên cả nước thông qua biểu diễn thời trang kết hợp quảng bá điểm đến, mang đến sự mới lạ cho khán giả.</p>\n<p>Còn Vietnam Junior Fashion Week (Tuần lễ thời trang trẻ em) tiếp tục lan tỏa thông điệp về chiến dịch &quot;Bảo vệ quyền trẻ em&quot;, góp phần bảo vệ quyền lợi chính đáng cho các em.</p>\n<p>Hai tuần lễ thời trang này diễn ra xen kẽ nhau, quy tụ khoảng 1.000 người mẫu lớn và nhí. Trong đó, có khoảng 100 văn nghệ sĩ như Hương Giang, Cindy Thái Tài, TyhD Thùy Dương, Cao Thiên Trang, bé Thỏ - con Xuân Lan, gia đình ca sĩ Khánh Đơn, ca sĩ Khánh Linh, nghệ sĩ violin Hoàng Rob… Nguyễn Ngọc Lâm làm tổng đạo diễn chương trình.</p>\n<p><img src=\"https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/cao-thien-trang-first-face-cho-thuong-hieu-lalalune-16568667181231738894820.jpeg\" alt=\"\"></p>\n<p>Góp mặt trong hai show thời trang này có 15 nhà thiết kế như Trương Thanh Long, Linh San, Dexnol, An ST, Tommy Trường, Lê Thanh Phương, Trinh Châu, Ó Princess, Eunoiabyan, Guon, Thỏ Nhím…</p>\n<p>Hương Giang, TyhD, Cao Thiên Trang… giữ vị trí quan trọng cho các bộ sưu tập. Trong đó, Hương Giang hóa nữ hoàng biển xanh, giữ vai trò vedette trong bộ sưu tập &quot;Hành vân lưu thủy&quot; của nhà thiết kế An ST.</p>\n<p>Thông qua bộ sưu tập này, các người mẫu mong muốn truyền tải được thông điệp vận hành tuần hoàn của tự nhiên, đồng thời nhắc nhớ về cuộc sống an yên.</p>\n<p><img src=\"https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/hoa-hau-huong-giang-vedette-cho-ntk-anst-16568667990581116382954.jpeg\" alt=\"\"></p>\n<p>Nhà thiết kế Tommy Tường Lê mang đến bộ sưu tập &quot;Khi giấc mơ về&quot; với những mẫu thiết kế mới, gợi ý xu hướng mùa hè.</p>\n<p>Nhà thiết kế Trương Thanh Long trình làng bộ sưu tập &quot;Kẹo bông và đám mây&quot;, được lấy ý tưởng từ những đám mây trắng bay lượn, đó là một thế giới ngập tràn màu hồng, màu của ngọt ngào và yêu thương.</p>\n<p><img src=\"https://cdn.tuoitre.vn/thumb_w/586/2022/7/3/thuy-duong-vedette-cho-thuong-hieu-lalalune-16568668658431739049668.jpeg\" alt=\"\"></p>\n<p>Bộ sưu tập &quot;Cầu vồng trên biển&quot; cũng để lại ấn tượng trong khán giả với những chiếc đầm được cắt xẻ tinh tế từ kiểu dáng đến các họa tiết. Đặc biệt, gia đình ca sĩ Khánh Đơn xuất hiện với vai trò vedette.</p>\n<p>Bên cạnh đó, nhiều nhà thiết kế đã giới thiệu đến công chúng những bộ sưu tập mới nhất, gợi ý phong cách thời trang cho nhiều người và có cả những em nhỏ.</p>\n<p>Hai đêm diễn thời trang thu hút đông đảo khán giả đến theo dõi.</p>\n', 16, 48, '2022-07-05 16:38:41', '2022-12-25 23:12:16');

